package main

import (
	"TCPSocketDemo/protocol"
	"flag"
	"fmt"
	"net"
)

var host = flag.String("h", "", "host")
var port = flag.String("p", "9999", "port")

func main() {
	flag.Parse()
	listen, err := net.Listen("tcp", *host+":"+*port)
	if err != nil {
		panic(err)
	}
	fmt.Println("listen at ", listen.Addr())
	defer func() {
		listen.Close()
		fmt.Println("listen closed")
	}()
	for {
		con, err := listen.Accept()
		if err != nil {
			fmt.Println("listen.accept error", err)
		}
		go handleConnection(con)
	}
}

func handleConnection(con net.Conn) {
	fmt.Println("handleConnection...")
	fmt.Printf("remoteAddr is %s localAddr is %s\n", con.RemoteAddr(), con.LocalAddr())
	defer func() {
		con.Close()
		fmt.Println("connection is close...")
	}()
	con.Write([]byte("你好，客户端"))
	buffer := make([]byte, 2048)
	for {
		n, err := con.Read(buffer)
		if err != nil {
			fmt.Println("read buffer error", err)
			if err.Error() == "EOF" {
				return
			}
		}
		response := buffer[:n]
		fmt.Printf("收到客户端的消息%s\n", response)
		m := NewMessage()
		data := protocol.EnPacket(m)
		con.Write(data)
	}

}

